                <Row xs={1} md={2} className="g-4">

                    <Col xs={'auto'} md={4}>
                    <CardSensor/>
                    </Col>
                    <Col xs={'auto'} md={4}>
                    <CardSensor/>
                    </Col>
                    <Col xs={'auto'} md={4}>
                    <CardSensor/>
                    </Col>

                </Row>
            </Container>


        </div>


    );
}



export default Home;
